// @name        TrolleyHub 
// @namespace   Violentmonkey Scripts
// @match       *://github.com/*
// @grant       none
// @version     1.0
// @author      Blusk
// @description 11/10/2021, 1:43:57 PM
// ==/UserScript==

const tr = "data:image/png;base64,"
const troll = "data:image/png;base64,";
const trollcrazy = "data:image/png;base64,";

const replacements = {
  '.octicon-issue-opened.open, .octicon-issue-opened.color-text-success, [title="Status: Open"] > .octicon-issue-opened': '🥴',
  '.octicon-issue-closed.closed': '☑️',
  '.octicon.octicon-git-pull-request-draft': `<img src="${tr}" style="margin-top: 5px; width: 16px; height: 16px;">`,
  '.octicon-git-pull-request.open': `<img src="${troll}" style="margin-top: 5px; width: 16px; height: 16px;">`,
  '.octicon-git-pull-request-closed.closed': `<img src="${trollcrazy}" style="margin-top: 5px; width: 16px; height: 16px;">`,
  '.octicon-git-merge.merged, .octicon-git-merge.color-fg-done': `✅`,
}

function applySubstitutions() {
  for (const [match, substitute] of Object.entries(replacements)) {
    document.querySelectorAll(match).forEach(el => el.parentElement.innerHTML = substitute)
  }
}

const observer = new MutationObserver((mutations) => {
  applySubstitutions()
})

observer.observe(document.body, {
  childList: true,
  subtree: true, // potential degrading performance but makes it work everywhere
})

window.addEventListener('load', applySubstitutions, false);
